import { NavBar } from "../NavBar";
import './Blog.css';

const BlogEntry = ({ title, body, image }) => {
    return (
    <section>
    <NavBar/>
      <div className="blog-entry">
        {image && <img src={image} alt={title} className="blog-entry-image" />}
        <h2 className="blog-entry-title">{title}</h2>
        <p className="blog-entry-body">{body}</p>
      </div>
    </section>

    );
  };

  export default BlogEntry;
